import React from 'react';
import './App.css';

const data = [{
  "name": "Rock",
  "email": "rock@demo.com",
  "designation": "Software Developer",
},
{
  "name": "Jone",
  "email": "jone@demo.com",
  "designation": "Java Developer",
},
{
  "name": "Tom",
  "email": "Tom@demo.com",
  "designation": "Frontend Developer",
},
{
  "name": "Robert",
  "email": "robert@demo.com",
  "designation": "Software Developer",
},
{
  "name": "Zac",
  "email": "zac@demo.com",
  "designation": "Software Developer",
},
{
  "name": "Ajay",
  "email": "ajay@demo.com",
  "designation": "Software Developer",
}]

function App() {
  return (
    <div className="App">
      <h1>MUI Datatable with react</h1>
      <ul>
      {data.map((value, index) => {
        return <li key={index}>{value.name}</li>
      })}
    </ul>
    </div>
  );
}

export default App;
